	,duration: function(time) {
		var h = time / 60 / 60 | 0;
		var m = (time / 60 | 0) - h * 60;
		var s = time % 60 | 0;
		var time = "" + m + ":";
		if(m < 10) {
			time = "0" + time;
		}
		if(h > 0) {
			time = "" + h + ":" + time;
		}
		if(s < 10) {
			time += "0";
		}
		time += s;
		return time;
	}
